Hi Guys,

We've had a multi-department team working on this all day and have isolated two issues:

1) Firehose delay
This is unrelated to your error, but a good thing to find. We found that your scoring queue was significantly backed up and didn't scale properly. Infrastructure scaled it to correct the issue but must look into this more with AWS during the Australian day, our evening. We're not sure if it's linked in any way--maybe multiple reattempts after an error exploded the queue, etc. But we'll continue to investigate and ask questions. We'll update you when we know more.

2) 10005 errors
This was really perplexing because the only logical ways this should be possible are:

a) if you try to initialize a session in review mode, before it has ever been initialized. (Technically, as far as we've discussed internally, you should be able to review after a session's first init. There won't be any responses at that point, but it shouldn't through a 10005 error (in review) even if there wasn't a save.) This seemed unlikely because you were unlikely to record a session_id as attempted without a save or submit.

b) if your content was changed after a session was saved. Initially, we were looking for something more process-related due to 4500 errors in 8 hours. Unfortunately, we couldn't find anything--and then it occurred to us that that behavior might occur if a large group of students used the same assessment with problem content, or if problem content was shared among multiple assessments.

Because this ticket included unrelated sessions (e.g. those on staging), we started from error logs from the prod consumer, found a session_id, and analyzed that session. It had three 10005 errors and we were able to verify three items had been edited. Questions were added after submission that did not appear in the captured session. As result, those response could not be found.&nbsp;

The session is attached and here are the affected items:
FT2592:&nbsp;Added file upload&nbsp;
FT533559: Added file upload 
FT533426: Added file upload&nbsp;

Another thing to note is, because we've been discussing the 4,500 errors on April 24 that you provided we're not sure what that number represents. It could include each 10005 error, and could include reattempts. For example, if the example session cited was responsible for every error, one attempt with the above three errors would mean only 1,500 assessments, not 4,500. If multiple attempts were recorded, the total might drop to 750, or lower, etc.

Recommendation
We think the best thing for you to do is look at the affected sessions and see if you can identify items that have changed since they were saved. We think this is important for systemic reasons so you can understand, from a version control viewpoint, how content is being changed after appearing in live assessments.&nbsp;

Our conversation about item pools touches this. I provided notes to Dan, which I think he forwarded, and I'm happy to jump on a call to discuss.

In the meantime
We tried to use a related property designed to address this issue when resuming a session, and it works. This doesn't cover the exact intended use case, but the principle is the same. I will verify with engineering that it is not a surprise that this works.

All you need to do is add the captureOnResumeError property to your init packet. This will act as if the missing responses are captured and prevent a 10005 error from being thrown.

