Hi Laine,

The tag.either filter will show every item that has the tag Grade: 3 or Subject: Math. If any item has either of these tags it will display it on the list view. You will need to add the "none" property which will exclude items with tags defined within, for example, all other grades and subjects (example below).&nbsp;

Just to note, the tag names can also follow a&nbsp; format where the name property can be an array of strings which makes it more convenient to specify multiple tags of the same type. You can see this done in the "none" property below.
 "filter": {&nbsp; "restricted": {
&nbsp; &nbsp; "current_user": false,
&nbsp; &nbsp; "status": ["published"],
&nbsp; &nbsp; "tags": {
&nbsp; &nbsp; &nbsp; "either": [
&nbsp; &nbsp; &nbsp; &nbsp; {
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; "type": "Grade",
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; "name": "3"
&nbsp; &nbsp; &nbsp; &nbsp; }, {
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; "type": "Subject",
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; "name": "Math"
&nbsp; &nbsp; &nbsp; &nbsp; }
&nbsp; &nbsp; &nbsp; ],
&nbsp; &nbsp; &nbsp; "none": [
&nbsp; &nbsp; &nbsp; &nbsp; {
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; "type": "Subject",
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; "name": ["English", "History", ...]
&nbsp; &nbsp; &nbsp; &nbsp; }, {
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; "type": "Grade",
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; "name": ["1","2", "4", ...]
&nbsp; &nbsp; &nbsp; &nbsp; }
&nbsp; &nbsp; &nbsp; ]
&nbsp; &nbsp; }
&nbsp; }
}

Just to give you an overview of the different tag restrictions, I've added a brief description of each below:
  tags.all - If there is more than one entry in tags.all, Items are only displayed if they have all of the tags specified for each entry in this initialization option. (I'm assuming there will be other tags on these items so I've opted out to not use this)
  tags.either - Items are only displayed if they have at least one of the tags specified for at least one entry in this initialization option.
  tags.none - Items are only displayed if they don't have each tag specified for each entry in this initialization option.  
I hope this helps. Please let me know if anything needs more clarification.

